import { useState } from "react";

const Jokes = () => {
  const [text, setText] = useState();
  //
  const months = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
  ];

  const random = Math.floor(Math.random() * months.length);
  console.log(random, months[random]);
};
export default Jokes;
